/* Replace with your SQL commands */
CREATE TABLE Authors(
  id serial primary key,
  name text NOT NULL,
  surname text,
  birthday date NOT NULL,
  age int NOT NULL
);

CREATE TABLE Books(
  id serial primary key, 
  title text not null,
  author_id int,
  publish_date date not null,
  FOREIGN KEY (author_id) REFERENCES Authors(id) ON DELETE CASCADE
);


